import React, { Component } from 'react';
import './login.scss'
import Logo from '../assets/img/fitness_script_logo.svg'

import { Button, TextField, FormControl, FilledInput } from '@material-ui/core';

class Login extends Component {


    render() {
        return (
            <div className="login">
                <h1 className="login__title">Fitness Script</h1>
                <img className="login__logo" src={Logo} alt="" />

                <FormControl variant="filled" className="login__form">
                    <TextField
                        className="login__form-input"
                        id="filled-basic"
                        label="Email"
                        // value={currency}
                        // onChange={handleChange}
                        // SelectProps={{
                        //     native: true,
                        // }}
                        variant="filled" >
                    </TextField>

                    <FilledInput
                        id="filled-adornment-weight"
                        value={values.weight}
                        onChange={handleChange('weight')}
                        endAdornment={<InputAdornment position="end">Kg</InputAdornment>}
                        aria-describedby="filled-weight-helper-text"
                        inputProps={{
                            'aria-label': 'weight',
                        }}
                    />

                    <Button variant="contained"
                        className="login__form-btn">
                        Sign In
                    </Button>

                    <Button variant="contained"
                        className="login__form-btn">
                        Create an Account
                    </Button>

                </FormControl>
            </div>
        );
    }
}

export default Login;
